import React, { useState, useEffect } from 'react';
import './dashboard.css';
import Cards from '../cardcomponent/Cards';
import Report from '../report/Report';
import RecentSels from '../sales/RecentSels';
import TopSellingProduct from '../sales/TopSellingProduct';

function Dashboard() {
  const [cards, setCards] = useState([]);
  const [isDarkMode, setIsDarkMode] = useState(false);

  const fetchData = () => {
    fetch('http://localhost:4000/cards')
      .then(res => res.json())
      .then(data => {
        setCards(data);
      })
      .catch(e => console.log(e.message));
  };

  useEffect(() => {
    fetchData();
  }, []);

  const toggleDarkMode = () => {
    setIsDarkMode(!isDarkMode);
    document.body.classList.toggle('dark-mode', !isDarkMode);
  };

  return (
    <section className={`dashboard section ${isDarkMode ? 'dark-mode' : ''}`}>
      <div className="top-nav">
        <button onClick={toggleDarkMode} className="dark-mode-toggle" style={{padding}}>
          {isDarkMode ? 'Light Mode' : 'Dark Mode'}
        </button>
      </div>
      <div className="row">
        <div className="col-lg-8">
          <div className="row">
            {cards && cards.length > 0 &&
              cards.map(card => <Cards key={card._id} card={card} />)
            }
            <div className="col-12">
              <Report />
            </div>
            <div className='col-12'>
              <RecentSels />
            </div>
            <div className='col-12'>
              <TopSellingProduct />
            </div>
          </div>
        </div>
        <div className="col-lg-4">
          {/* Add your additional content here */}
        </div>
      </div>
    </section>
  );
}

export default Dashboard;
